import axios from "axios";

const UseCustomFetch = async(url) => {
    const [data, setData] = useState(null);
    useEffect(() => {
      axios.get(url)
        .then((data) => setData(data));
    }, [url]);
  
    return [data];
};
export default UseCustomFetch;
